import React from 'react';

const style = `
.header {
  height: 50vh;
  width: 80%;
  background: url(https://giphy.com/gifs/visuals-network-fiber-optics-ZcdJJvDqTgdGZK8Xd3) repeat center;
  background-size: cover;

}
`;

const Header = () => {
  return (
    <div className="header">
      <style>{style}</style>
    </div>
  );
};

export default Header;
